CREATE TABLE CIDADE (
	CD_CIDADE INTEGER NOT NULL,
	NM_CIDADE VARCHAR(60) NOT NULL,
	SG_UF     CHAR(2) NOT NULL,
 PRIMARY KEY (CD_CIDADE));

CREATE TABLE ESTOQUE (
	DATA DATE   NOT NULL,
	SEQUENCIA   INTEGER NOT NULL,
	CD_ITEM     INTEGER NOT NULL,
	QT_MOV      DOUBLE PRECISION NOT NULL,
	VL_UNITARIO DOUBLE PRECISION NOT NULL,
	ST_ATCUSTOMEDIO CHAR(1) NOT NULL,
 PRIMARY KEY (DATA,SEQUENCIA,CD_ITEM));

CREATE TABLE ITEM (
	CD_ITEM       INTEGER NOT NULL,
	DS_ITEM       VARCHAR(60) NOT NULL,
	SG_UNIDADE    CHAR(3),
	VL_CUSTO      DOUBLE PRECISION,
	VL_VENDA      DOUBLE PRECISION,
	VL_CUSTOMEDIO DOUBLE PRECISION,
	QT_DISPONIVEL DOUBLE PRECISION DEFAULT 0,
 PRIMARY KEY (CD_ITEM));

CREATE TABLE NATUREZA (
	CD_NATUREZA     INTEGER NOT NULL,
	DS_NATUREZA     VARCHAR(60) NOT NULL,
	ST_ATCUSTOMEDIO CHAR(1) NOT NULL,
 PRIMARY KEY (CD_NATUREZA));

CREATE TABLE PEDIDO (
	CD_PEDIDO   INTEGER NOT NULL,
	TP_PEDIDO   CHAR(1) NOT NULL,
	CD_PESSOA   INTEGER NOT NULL,
	CD_NATUREZA INTEGER NOT NULL,
	DT_EMISSAO  DATE NOT NULL DEFAULT CURRENT_DATE,
	VL_TOTAL    DOUBLE PRECISION,
 PRIMARY KEY (CD_PEDIDO,TP_PEDIDO));

CREATE TABLE PEDIDOITEM (
	CD_PEDIDO    INTEGER NOT NULL,
	TP_PEDIDO    CHAR(1) NOT NULL,
	CD_ITEM      INTEGER NOT NULL,
	QT_PEDIDA    DOUBLE PRECISION NOT NULL DEFAULT 1,
	VL_UNITARIO  DOUBLE PRECISION NOT NULL,
	PC_DESCONTO  DOUBLE PRECISION DEFAULT 0,
	PC_ACRESCIMO DOUBLE PRECISION DEFAULT 0,
	DATA         DATE,
	SEQUENCIA    INTEGER,
 PRIMARY KEY (CD_PEDIDO,TP_PEDIDO,CD_ITEM));

CREATE TABLE PESSOA (
	CD_PESSOA INTEGER NOT NULL,
	NM_PESSOA VARCHAR(60) NOT NULL,
	TP_PESSOA INTEGER NOT NULL,
 PRIMARY KEY (CD_PESSOA));

CREATE TABLE PESSOA_END (
	CD_PESSOA   INTEGER NOT NULL,
	CD_ENDERECO INTEGER NOT NULL,
	DS_ENDERECO VARCHAR(80) NOT NULL,
	NR_ENDERECO VARCHAR(10),
	NR_CEP      VARCHAR(10),
	CD_CIDADE   INTEGER,
 PRIMARY KEY (CD_PESSOA,CD_ENDERECO));

CREATE TABLE UNIDADE (
	SG_UNIDADE  CHAR(3) NOT NULL,
	DS_UNIDADE  VARCHAR(30),
	NR_DECIMAIS INTEGER DEFAULT 0,
 PRIMARY KEY (SG_UNIDADE));
















































































ALTER TABLE PESSOA_END ADD FOREIGN KEY (CD_CIDADE) REFERENCES CIDADE (CD_CIDADE);
ALTER TABLE ESTOQUE ADD FOREIGN KEY (CD_ITEM) REFERENCES ITEM (CD_ITEM);
ALTER TABLE PEDIDOITEM ADD FOREIGN KEY (CD_ITEM) REFERENCES ITEM (CD_ITEM);
ALTER TABLE PEDIDO ADD FOREIGN KEY (CD_NATUREZA) REFERENCES NATUREZA (CD_NATUREZA);
ALTER TABLE PEDIDOITEM ADD FOREIGN KEY (CD_PEDIDO,TP_PEDIDO) REFERENCES PEDIDO (CD_PEDIDO,TP_PEDIDO);
ALTER TABLE PEDIDO ADD  FOREIGN KEY (CD_PESSOA) REFERENCES PESSOA (CD_PESSOA);
ALTER TABLE PESSOA_END ADD  FOREIGN KEY (CD_PESSOA) REFERENCES PESSOA (CD_PESSOA);
ALTER TABLE ITEM ADD  FOREIGN KEY (SG_UNIDADE) REFERENCES UNIDADE (SG_UNIDADE);